function getSmallestIndexes(arr, k) {
    // 上位k件の最小値を持つ要素のインデックスを返す
    const indexes = [];

    for (let i = 0; i < k; i++) {
        let minValue = Infinity;
        let minIndex = -1;

        for (let j = 0; j < arr.length; j++) {
            if (indexes.includes(j)) {
                continue; // Skip if index already selected
            }

            if (arr[j] < minValue) {
                minValue = arr[j];
                minIndex = j;
            }
        }

        indexes.push(minIndex);
    }

    return indexes;
}




